import React from "react";

import './ExpenseForm.css';

const ExpenseForm = () => {
  return (
    <form>
      <div>
        <div>
          <input type="text"/>
        </div>
        <div>
          <input type="number" min="0.01"/>
        </div>
        <div>
          <input type="date" min="" max=""/>
        </div>
      </div>
      <button type="submit" className="new-expense__actions">Add New Expense</button>
    </form>
  );
}

export default ExpenseForm;
